import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

const Footer = () => {
  return (
    <footer className="footer bg-dark text-light text-center py-3">
      <div className="container">
        <p>&copy; 2025 Unstoppable GRP3. All rights reserved.</p>
        <p>Contact: support@emart.com | Toll-Free: 1800-123-4567</p>
        <p>Address: 123 E-Mart Street, Commerce City, USA</p>
      </div>
    </footer>
  );
};

export default Footer;
